import React from 'react';

const Home = () => {
    return (
        <div
            style={{
                fontFamily: 'Times New Roman'
            }}
        >
            <h1>hiiiii !</h1>
            <body>my name is Logan Keener, I'm a student in my fourth year at UBC doing computer science and math among other coooool things :3

                CURRENTLY: I am taking a break from school for a co-op term! Also doing volunteer work for the <a href="https://www.artjusticeresearch.org/">A.R.T. Justice project</a>, helping create educational material for formerly incarcerated individuals.

                When I am in school, I'm interested in:
                <li>
                    <li>
                        Machine learning & data analytics
                    </li>
                    <li>

                    </li>
                </li>
            </body>
        </div>
        // to include on home page:
        // what I'm interested in
        // social media
    );
};

export default Home;
